import { Avatar, Menu } from "antd";
import logo from "../../images/logo.png";
import { Link, useHistory, useLocation } from "react-router-dom";
import { useContext, useEffect, useState } from "react";
import { StyledNavButton } from "../Styles/Button.style";
import { AuthStatusContext } from "../../utils/AuthState";
import { Auth } from "aws-amplify";
import { StyledNavLink } from "../Styles/Link.style";

const Navbar = () => {
  const { loggedIn, setLoggedIn } = useContext(AuthStatusContext);
  const history = useHistory();

  useEffect(() => {
    assessLoggedInState();
  }, []);

  const assessLoggedInState = () => {
    Auth.currentAuthenticatedUser()
      .then(() => {
        setLoggedIn(true);
      })
      .catch(() => {
        setLoggedIn(false);
      });
  };

  const onLogOut = async () => {
    try {
      await Auth.signOut();
      setLoggedIn(false);
      history.push("/");
    } catch (error) {
      console.log("error signout out: ", error);
    }
  };

  return (
    <Menu theme="dark" mode="horizontal">
      <Link to={loggedIn ? "/results" : "/"}>
        <Avatar src={logo} size="large" />
      </Link>
      {loggedIn ? (
        <StyledNavButton type="primary" onClick={onLogOut}>Log Out</StyledNavButton>
      ) : (
        <StyledNavLink to="/login">
          <StyledNavButton type="primary">Log In</StyledNavButton>
        </StyledNavLink>
      )}
    </Menu>
  );
};

export default Navbar;
